import { Component, OnInit } from '@angular/core';
import { CarService } from '../services/car.service';

@Component({
  selector: 'app-car-add',
  templateUrl: './car-add.page.html',
  styleUrls: ['./car-add.page.scss'],
})
export class CarAddPage implements OnInit {

  constructor(private carService: CarService) { }

  ngOnInit() {
  }

  addCar(){
    let car = {
      modelo: modelo,
      marca: marca,
      precio: precio,
      descripcion: descripcion
    }
    this.carService.add(car).subscribe(response =>{
      console.log("Oferta añadida");
    })
  }

}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>
      Añadir coche
    </ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true" class="bicycle-add-content">
  <ion-button (click)="addCar()" expand="full">Añadir coche</ion-button>
</ion-content>
